import React from 'react';

import {StyleSheet, css} from 'aphrodite';
import './index.css';

import shiro from './images/shiro.png';
import akame from './images/akame.png';

export default class Menu extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div className={css(style.container)}>
                <div className={css(style.titleContainer)}>
                    <h1 className={css(style.titleText, style.titleGradient)}>React Sandbox</h1>
                    <h1 className={css(style.titleThickness)}>React Sandbox</h1>
                </div>
                
                <div>
                    <img src={shiro} alt='shiro'/>
                    {/* <div class='shadow'></div> */}
                </div>
                <h1 >-</h1>
                <div>
                    <div>
                        <button onClick={() => this.props.handleDisplayChange(1)}>
                            <img src={akame}/>
                            <h1>Image Collage</h1>
                        </button>
                    </div>
                </div>
            </div>
        )
    }
}

const style = StyleSheet.create({
    container: {
        backgroundColor: "#E7CFEA",
        position: 'relative'
    },

    titleContainer:{
        width:700,
        height:500,
        margin:'auto',
        paddingTop:100
    },

    titleText:{
        fontSize: 120,
        textAlign: 'center',
        margin:'auto',
    },

    titleGradient:{
        backgroundImage: 'linear-gradient(45deg, #efe633, #998CD9)',
        backgroundClip: 'text',
        color:'rgba(0,0,0,0)'
    },

    titleThickness:{
        textStroke: '20px azure'
    }
})
